import React from "react";

import {
  Option,
  Select,
} from './styled';

const SelectList = ( { data, title } ) => {
  return (
    <Select>
      <Option disabled selected>Color</Option>
      <Option>White</Option>
      <Option>Black</Option>
      <Option>Red</Option>
      <Option>Blue</Option>
      <Option>Yellow</Option>
      <Option>Green</Option>
    </Select>
  );
};

export default SelectList;
